with fatpay1 as (
    select 
        fatpay_country as card_country,
        card_bank,
        card_bin,
        amount_eur,
        order_id,
        status_name,
        'period 1' as period_type
    from MART.FATPAY
    where -- IS_CARD_BINDING = FALSE and IS_REPEAT = FALSE and 
        {{CREATED_AT}}
        and {{CARD_GEOSCHEME}}
        and {{CARD_COUNTRY}}
        and {{BUSINESS_NAME}}
        and {{USER_NAME}}
        and {{FIAT_CURRENCY}}
        and {{ACQUIRER}}
        and {{CARD_BRAND}}
        and {{PAYMENT_TERMINAL}}
        and {{SHOP}}
        and {{CARD_BANK}}
        and {{CARD_BIN}}
        and {{is_aft}} 
), 

fatpay2 as (
    select 
        fatpay_country as card_country,
        card_bank,
        card_bin,
        amount_eur,
        order_id,
        status_name,
        'period 2' as period_type
    from MART.FATPAY
    where -- IS_CARD_BINDING = FALSE and IS_REPEAT = FALSE and 
        {{CREATED_AT2}}
        and {{CARD_GEOSCHEME}}
        and {{CARD_COUNTRY}}
        and {{BUSINESS_NAME}}
        and {{USER_NAME}}
        and {{FIAT_CURRENCY}}
        and {{ACQUIRER}}
        and {{CARD_BRAND}}
        and {{PAYMENT_TERMINAL}}
        and {{SHOP}}
        and {{CARD_BANK}}
        and {{CARD_BIN}}
        and {{is_aft}} 
), 

fatpay as (
    select fatpay1.* 
    from fatpay1
    union all 
    select fatpay2.* 
    from fatpay2
),

total_ar as (
    select 
        period_type,
        count(*) as count_transactions,
        count(distinct case when status_name='complete' then order_id end) as count_transactions_accepted
    from fatpay 
    group by 1 
)

select 
    fatpay.card_country,
    fatpay.card_bank,
    --fatpay.card_bin,
    count(*) as count_transactions,

    case 
        when count(distinct case when fatpay.period_type='period 1' then order_id end) > 0 
            then count(distinct case when fatpay.period_type='period 1' and status_name='complete' then order_id end)
                    /count(distinct case when fatpay.period_type='period 1' then order_id end)
        else Null 
    end as ar_period1,

    case 
        when count(distinct case when fatpay.period_type='period 2' then order_id end) > 0 
            then count(distinct case when fatpay.period_type='period 2' and status_name='complete' then order_id end)
                    /count(distinct case when fatpay.period_type='period 2' then order_id end)
        else Null 
    end as ar_period2,

    case 
        when count(distinct case when fatpay.period_type='period 1' then order_id end) > 0 
            and count(distinct case when fatpay.period_type='period 2' then order_id end) > 0 
            then (count(distinct case when fatpay.period_type='period 2' and status_name='complete' then order_id end)
                    /count(distinct case when fatpay.period_type='period 2' then order_id end)) - 
                 (count(distinct case when fatpay.period_type='period 1' and status_name='complete' then order_id end)
                    /count(distinct case when fatpay.period_type='period 1' then order_id end))
        else Null 
    end as delta_ar,
    count(distinct case when fatpay.period_type='period 1' and status_name='complete' then order_id end)/
        listagg(distinct case when fatpay.period_type='period 1' then total_ar.count_transactions_accepted end) as input_ar1,
    count(distinct case when fatpay.period_type='period 2' and status_name='complete' then order_id end)/
        listagg(distinct case when fatpay.period_type='period 2' then total_ar.count_transactions_accepted end) as input_ar2,

    count(distinct case when fatpay.period_type='period 1' then order_id end) as count_transactions_period1,
    count(distinct case when fatpay.period_type='period 2' then order_id end) as count_transactions_period2,
    sum(case when fatpay.period_type='period 1' then amount_eur end) as potential_turnover_eur_period1,
    sum(case when fatpay.period_type='period 2' then amount_eur end) as potential_turnover_eur_period2,
    sum(case when fatpay.period_type='period 1' and status_name='complete' then amount_eur end) as turnover_eur_period1,
    sum(case when fatpay.period_type='period 2' and status_name='complete' then amount_eur end) as turnover_eur_period2
from fatpay
left join total_ar on fatpay.period_type = total_ar.period_type
group by 1, 2 
order by 3 desc

WITH oor1 as (
    select 
        card_isocountry as card_country,
        card_bank_title as card_bank,
        card_bin,
        fiat_amount_eur as amount_eur,
        turnover_eur,
        id,
        confirmed,
        'period 1' as period_type
    from mart.transactions
    where 
        {{CREATED_AT}} 
        and TRANSACTIONS.SOURCE_MAIN = 'widget' 
        and card_isocountry is not null
        and {{type_operation}} 
        and {{partner_name}} 
        and {{crypto_currency}} 
        and {{fiat_currency}} 
        and {{country_card}} 
        and {{card_bank}} 
        and {{card_bin}} 
        and {{brand_card}} 
        and {{pay_system}} 
        and {{CARD_GEOSCHEME}} 
        and {{vendor_name}} 
        and {{network}} 
        and {{antifraud_status}} 
        and {{retry_exclude}} 
        and {{is_aft}} 
),

oor2 as (
    select 
        card_isocountry as card_country,
        card_bank_title as card_bank,
        card_bin,
        fiat_amount_eur as amount_eur,
        turnover_eur,
        id,
        confirmed,
        'period 2' as period_type
    from mart.transactions
    where 
        {{CREATED_AT2}} 
        and TRANSACTIONS.SOURCE_MAIN = 'widget' 
        and card_isocountry is not null
        and {{type_operation}} 
        and {{partner_name}} 
        and {{crypto_currency}} 
        and {{fiat_currency}} 
        and {{country_card}} 
        and {{card_bank}} 
        and {{card_bin}} 
        and {{brand_card}} 
        and {{pay_system}} 
        and {{CARD_GEOSCHEME}} 
        and {{vendor_name}} 
        and {{network}} 
        and {{antifraud_status}} 
        and {{retry_exclude}} 
        and {{is_aft}} 
),

oor as (
    select oor1.* 
    from oor1
    union all 
    select oor2.* 
    from oor2
),

total_ar as (
    select 
        period_type,
        count(*) as count_transactions,
        count(distinct case when confirmed then id end) as count_transactions_accepted
    from oor 
    group by 1 
)

select
    oor.card_country,
    oor.card_bank,
    oor.card_bin,
    count(*) as count_transactions,
    
    case 
        when count(distinct case when oor.period_type='period 1' then id end) > 0 
            then count(distinct case when oor.period_type='period 1' and confirmed then id end)
                    /count(distinct case when oor.period_type='period 1' then id end)
        else Null 
    end as ar_period1,
    
    case 
        when count(distinct case when oor.period_type='period 2' then id end) > 0 
            then count(distinct case when oor.period_type='period 2' and confirmed then id end)
                    /count(distinct case when oor.period_type='period 2' then id end)
        else Null 
    end as ar_period2,
    
    case 
        when count(distinct case when oor.period_type='period 1' then id end) > 0 
            and count(distinct case when oor.period_type='period 2' then id end) > 0 
            then (count(distinct case when oor.period_type='period 2' and confirmed then id end)
                    /count(distinct case when oor.period_type='period 2' then id end)) - 
                 (count(distinct case when oor.period_type='period 1' and confirmed then id end)
                    /count(distinct case when oor.period_type='period 1' then id end))
        else Null 
    end as delta_ar,
    count(distinct case when oor.period_type='period 1' and confirmed then id end)/
        listagg(distinct case when oor.period_type='period 1' then total_ar.count_transactions_accepted end) as input_ar1,
    count(distinct case when oor.period_type='period 2' and confirmed then id end)/
        listagg(distinct case when oor.period_type='period 2' then total_ar.count_transactions_accepted end) as input_ar2,
    
    count(distinct case when oor.period_type='period 1' then id end) as count_transactions_period1,
    count(distinct case when oor.period_type='period 2' then id end) as count_transactions_period2,
    sum(case when oor.period_type='period 1' then amount_eur end) as potential_turnover_eur_period1,
    sum(case when oor.period_type='period 2' then amount_eur end) as potential_turnover_eur_period2,
    sum(case when oor.period_type='period 1' and confirmed then turnover_eur end) as turnover_eur_period1,
    sum(case when oor.period_type='period 2' and confirmed then turnover_eur end) as turnover_eur_period2
from oor
left join total_ar on oor.period_type = total_ar.period_type
group by 1, 2, 3
order by 4 desc

